const process = function(message) {
    let [command, index, value] = message.data;

    if(command >= 176 && command <= 191){
        let channel = command - 176;
        console.log('channel:',command-175,'cc:', index, 'value:', value);
        this.map[channel].cc[index](value);

    } else if(command >= 144 && command <= 159){
        let channel = command - 144;
        // console.log('channel:',command-143,'noteon:', index, 'velocity:', value);
        this.processNote(channel, index, value);
        this.map[channel].note[index](value);

    } else if(command >= 128 && command <= 143){
        let channel = command - 128;
        if(value=='undefined') value = 0;
        // console.log('channel:',command-127,'noteoff:', index, 'velocity:', value);
        this.map[channel].noteOff[index](0);

    } else {

    }
}

export default process;